import math

def la_contasion(numeros, intervalos):
    contadores = [0]* (len(intervalos)-1)
    paso = intervalos[1] - intervalos[0]
    for i in range (1,len(intervalos)):
        for j in range(len(numeros)):
            if numeros[j] <= intervalos[i]:
                if numeros[j] == intervalos[i]:
                    contadores[i-1] += 1
                    j +=1
                if numeros[j] >= intervalos[i] - paso:
                    contadores[i-1] +=1
                    j+=1
    print(sum(contadores))
    return contadores

def truncate(number, digits) -> float:
    stepper = 10.0 ** digits
    return math.trunc(stepper * number) / stepper


